import React, { useState } from 'react';
import { BrowserRouter as Router, Switch, Redirect, Route } from 'react-router-dom';
import Contact from './Contact';
import Register from './Register';
import Login from './Login';
import About from './About';
import Home from './Home';
import Protected from './Protected'
import SelectBrand from './SelectBrand';
import Product from './Product';
import Header from './Header';

import Gender_product from './Gender_product';
import Gender from './Gender';
import Male_category from './Male_category';
import Female_category from './Female_category';
const Main = () => {



    return (
        <>
            <Header />


            <Switch>

                {/* Nav bar */}
                <Route exact path='/login' component={Login} />

                <Route exact path='/register' component={Register} />
                <Route exact path='/selectbrand' component={SelectBrand} />

                <Route exact path='/home'>
                    <Protected component={Home} />
                </Route>


                <Route exact path='/about'>
                    <Protected component={() => {
                        return <About />
                    }} /></Route>

                <Route exact path='/women'>
                    <Protected component={() => {
                        return <Gender_product name="female" />
                    }} /></Route>

                <Route exact path='/men'>
                    <Protected component={() => {
                        return <Gender_product name="male" />
                    }} /></Route>

                <Route exact path='/kid'>
                    <Protected component={() => {
                        return <Gender_product name="kid" />
                    }} /></Route>


                <Route exact path='/contact'>
                    <Protected component={() => {
                        return <Contact />
                    }} /></Route>




                <Route exact path='/khaadi'>
                    <Protected component={() => {
                        return <Gender name="khaadi" />
                    }} /></Route>
                <Route exact path='/gulahmed'>
                    <Protected component={() => {
                        return <Gender name="gulahmed" />
                    }} /></Route>

                <Route exact path='/bata'>
                    <Protected component={() => {
                        return <Gender name="bata" />
                    }} /></Route>

                <Route exact path='/mariab'>
                    <Protected component={() => {
                        return <Gender name="Maria.B" />
                    }} /></Route>

                <Route exact path='/sanasafinaz'>
                    <Protected component={() => {
                        return <Gender name="sanasafinaz" />
                    }} /></Route>

                {/* navbar end */}


                {/* Male category for all branda */}


                <Route exact path='/gulahmed-male_category'>
                    <Protected component={() => {
                        return <Male_category name='gulahmed' />
                    }} /></Route>

                <Route exact path='/khaadi-male_category'>
                    <Protected component={() => {
                        return <Male_category name='khaadi' />
                    }} /></Route>

                <Route exact path='/bata-male_category'>
                    <Protected component={() => {
                        return <Male_category name='bata' />
                    }} /></Route>

                <Route exact path='/sanasafinaz-male_category'>
                    <Protected component={() => {
                        return <Male_category name='Sana safinaz' />
                    }} /></Route>

                <Route exact path='/mariab-male_category'>
                    <Protected component={() => {
                        return <Male_category name='Maria.B' />
                    }} /></Route>

                {/* Male category end */}

                {/* female catery start */}
                <Route exact path='/gulahmed-female_category'>
                    <Protected component={() => {
                        return <Female_category name='gulahmed' />
                    }} /></Route>

                <Route exact path='/khaadi-female_category'>
                    <Protected component={() => {
                        return <Female_category name='khaadi' />
                    }} /></Route>

                <Route exact path='/bata-female_category'>
                    <Protected component={() => {
                        return <Female_category name='bata' />
                    }} /></Route>

                <Route exact path='/sanasafinaz-female_category'>
                    <Protected component={() => {
                        return <Female_category name='Sana safinaz' />
                    }} /></Route>

                <Route exact path='/mariab-female_category'>
                    <Protected component={() => {
                        return <Female_category name='Maria.B' />
                    }} /></Route>

                {/* female category  end*/}


                {/* Gulahmed male */}
                <Route exact path='/gulahmed-male_eastren'>
                    <Protected component={() => {
                        return <Product name="Gulahmed-male-shirt_pant" />
                    }} /></Route>

                <Route exact path='/khaadi-male_eastren'>
                    <Protected component={() => {
                        return <Product name="khaadi-female-shirt_pant" />
                    }} /></Route>


                <Route exact path='/gulahmed-male_westren_unistitched'>
                    <Protected component={() => {
                        return <Product name="Gulahmed-male-kameezshalwar_unstitched" />
                    }} /></Route>
                <Route exact path='/gulahmed-male_westren_stitched'>
                    <Protected component={() => {
                        return <Product name="Gulahmed-male-kameezshalwar_stitched" />
                    }} /></Route>




                {/* gulahmed female */}
                <Route exact path='/gulahmed-female_westren'>
                    <Protected component={() => {
                        return <Product name="Gulahmed-female-shirt_pant" />
                    }} /></Route>

                <Route exact path='/gulahmed-female_eastren_stitched'>
                    <Protected component={() => {
                        return <Product name="Gulahmed-female-kameezshalwar_stitched" />
                    }} /></Route>
                <Route exact path='/gulahmed-female_eastren_unstitched'>

                    <Protected component={() => {
                        return <Product name="Gulahmed-female-kameezshalwar_unstitched" />
                    }} /></Route>

                <Route exact path='/gulahmed-female_shirt'>
                    <Protected component={() => {
                        return <Product name="Gulahmed-female-shirt" />
                    }} /></Route>

                <Route exact path='/gulahmed-female_trouser'>
                    <Protected component={() => {
                        return <Product name="Gulahmed-female-pant" />
                    }} /></Route>

                <Route exact path='/gulahmed-female_shawl'>
                    <Protected component={() => {
                        return <Product name="Gulahmed-female-shawl" />
                    }} /></Route>
                {/* gulahmed kid */}
                <Route exact path='/gulahmed-kid_category'>
                    <Protected component={() => {
                        return <Product name="Gulahmed-kid-shirt_pant" />
                    }} /></Route>


                {/********************** *Gulahmed End here********************* */}
                {/* gulahmed female */}
                <Route exact path='/khaadi-female_westren'>
                    <Protected component={() => {
                        return <Product name="khaadi-female-shirt_pant" />
                    }} /></Route>

                <Route exact path='/khaadi-female_eastren_stitched'>
                    <Protected component={() => {
                        return <Product name="khaadi-female-kameezshalwar_stitched" />
                    }} /></Route>
                <Route exact path='/gulahmed-female_eastren_unstitched'>

                    <Protected component={() => {
                        return <Product name="Gulahmed-female-kameezshalwar_unstitched" />
                    }} /></Route>

                <Route exact path='/gulahmed-female_shirt'>
                    <Protected component={() => {
                        return <Product name="Gulahmed-female-shirt" />
                    }} /></Route>

                <Route exact path='/gulahmed-female_trouser'>
                    <Protected component={() => {
                        return <Product name="Gulahmed-female-pant" />
                    }} /></Route>

                <Route exact path='/gulahmed-female_shawl'>
                    <Protected component={() => {
                        return <Product name="Gulahmed-female-shawl" />
                    }} /></Route>
                {/* gulahmed kid */}
                <Route exact path='/khaadi-kid_category'>
                    <Protected component={() => {
                        return <Product name="khaadi-kid-shirt_pant" />
                    }} /></Route>







                {/* <Route component={Error} /> */}
                {/* <Redirect to='/home' /> */}








            </Switch>



        </>
    )
}
export default Main;
